import React from 'react';
import { SafeAreaView } from 'react-native';

import Transactions from './components/transactions/transactions';

export default function App(){
  return(<>
  <SafeAreaView style={
  {
    marginTop: 20,
    flex: 1,
    flexDirection: "column",
    justifyContent: "space-between",
    alignItems: "center",
  }}>
    <Transactions/>
  </SafeAreaView>
  </>)
}
